import React, { Component } from 'react';

class AdminBodyList extends Component {
    render() {
        return (
            <div className="admin-body">
                <table>
                <th>image</th>
                <th>name</th>
        <th>birthdate</th>
        <th>race</th>
        <th>gender</th>
        <th>city</th>
        </table>
            </div>
        );
    }
}

export default AdminBodyList;
